function Navbar() {
  return (

     <div>
    <nav className="navbar navbar-light bg-white mb-5">
    <div className="container">
    <div className="navbar-header">
        <Link className="text-white text-lg brand-text navbar-brand" to="/">
                <img src="https://quicket.azureedge.net/media/0077673_0.Png" height="130" class="d-inline-block align-top  border border-white rounded "/> 
                </Link>
    </div>
        <div class="d-flex justify-content-center ">
  <div class="active p-2 bd-highlight ">

    </div>

</div>
<div class="d-flex justify-content-end">

     
        
    </div>
    </div>
    </nav>
    </div>



  );
}




export default Navbar;
